import Layout from '../components/Layout';
import Private from '../components/auth/Private';

const Index = () => {
    return (
        <Private>
            <Layout>
                <div className='app'>
                    <div className='app__body'>
                        <h2>Index page</h2>
                    </div>
                </div>
            </Layout>
        </Private>
    );
}

export default Index;
